import React, { Component } from 'react'

export default class List extends Component {
    
  render() {
    const names=['deepthi','mentor','sai','manasa']
    const nameList=names.map((name)=>{<h1>{name}</h1>})
    console.log(`in list ${nameList}`)
    return (
      <div>
        {nameList}
      </div>
    )
  }
}
